/**
 * @description : <head>태그 내의 SEO 처리 및 기본 참조 리소스 명시
 */
import React from 'react';
import { Helmet, HelmetProvider } from 'react-helmet-async';

const Meta = props => {
    return (
        <HelmetProvider>
            <Helmet>
                <meta charSet='utf-8' />
                <title>{props.title}</title>
                {/* SEO 태그 */}
                <meta name='description' content={props.description} />
                <meta name='keywords' content={props.keyword} />
                <meta name='author' content={props.author} />
                <meta name='subject' content={props.subject} />
                <meta name='copyright' content={props.copyright} />
                <meta name='content-language' content='ko' />
                <meta property='og:type' content='website' />
                <meta property='og:title' content={props.title} />
                <meta property='og:description' content={props.description} />
                <meta property='og:url' content={props.url} />
                <meta property='og:image' content={props.image} />
                <link rel='icon' href={props.icon} type='image/png' />
                <link rel='shortcut icon' href={props.shortcutIcon} type='image/png' />
                <link rel='apple-touch-icon' href={props.appleTouchIcon} type='image/png' />

                {/* 웹폰트 'Pretendard Variable' */}
                <link rel="stylesheet" as="style" crossorigin href="https://cdn.jsdelivr.net/gh/orioncactus/pretendard@v1.3.9/dist/web/static/pretendard.min.css" />
            </Helmet>
        </HelmetProvider>
    );
};

Meta.defaultProps = {
    title: 'React Example',
    description: 'React Example',
    author: '박성조',
    subject: 'React Example',
    copyright: '박성조',
    keyword: 'React',
    url: window.location.href,
    image: null,
    icon: null,
    shortcutIcon: null,
    appleTouchIcon: null,
};

export default Meta;
